import './App.css';

function App() {
  return (
    <div className="App">
    <div>
      <label>Name:</label>
      <input type="text"/>
      <label>Age:</label>
      <input type="number"/>
      <label>Country:</label>
      <input type="text"/>
      <label>Position:</label>
      <input type="text"/>
      <label>Salary:</label>
      <input type="number"/>
      </div>
    </div>
  );
}

export default App;
